DROP DATABASE IF EXISTS movie_db;

CREATE DATABASE movie_db;

USE movie_db;

-- 아키텍쳐
CREATE TABLE `user` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `nickname` varchar(255) NOT NULL,
  `gender` tinyint(1) NOT NULL,
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  CONSTRAINT UNIQUE_EMAIL UNIQUE (`email`),
  CONSTRAINT UNIQUE_NICKNAME UNIQUE (`nickname`)
);

CREATE TABLE `movie` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `genre` varchar(255) NOT NULL,
  `attendance` int unsigned NOT NULL,
  `year` date NOT NULL,
  PRIMARY KEY (`id`)
);

CREATE TABLE `review` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `movieId` int unsigned NOT NULL,
  `userId` int unsigned NOT NULL,
  `rating` tinyint NOT NULL,
  `content` varchar(255) NOT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `f_movieId_idx` (`movieId`),
  KEY `f_userId_idx` (`userId`),
  CONSTRAINT `f_movieId` FOREIGN KEY (`movieId`) REFERENCES `movie` (`id`),
  CONSTRAINT `f_userId` FOREIGN KEY (`userId`) REFERENCES `user` (`id`),
  CONSTRAINT `unique_review_per_user_per_movie` UNIQUE (`movieId`, `userId`)
);

CREATE TABLE `favorite_movies` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `userId` int unsigned NOT NULL,
  `movieId` int unsigned NOT NULL,
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_favorite` (`userId`, `movieId`),
  FOREIGN KEY (`userId`) REFERENCES `user`(`id`),
  FOREIGN KEY (`movieId`) REFERENCES `movie`(`id`)
);

CREATE TABLE `search_history` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `userId` int unsigned NOT NULL,
  `search_query` varchar(255) NOT NULL,
  `search_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_user_query` (`userId`, `search_query`),
  CONSTRAINT `f_userId_search_history` FOREIGN KEY (`userId`) REFERENCES `user` (`id`)
);




select * from user;
select * from movie;
select * from review;
select * from favorite_movies;
select * from search_history;

-- 회원가입 기능
-- input: email, password, nickname, gender
-- output: -
-- 특징: 사용자의 회원가입 정보를 입력받아 회원을 등록하는 기능
-- 설명: 사용자의 이메일, 비밀번호, 닉네임, 성별을 입력받아 회원가입을 수행합니다.
VALUES ('user@gmail.com', SHA2('password', 256), 'user', 0);

-- 회원정보 조회 기능
-- input: userId
-- output: 사용자 정보 (email, password, nickname, gender)
-- 특징: userId를 입력받아 해당 사용자의 회원정보를 조회하는 기능
-- 설명: 특정 userId에 해당하는 사용자의 회원정보를 조회합니다.
SELECT * FROM user WHERE id = 20;

-- 영화 정보 조회 기능
-- input: userId
-- output: 영화명, 리뷰 갯수, 별점 평균, 즐겨찾기된 영화인지 여부 (내림차순, 페이징)
-- 특징: 영화별 리뷰 갯수와 별점 평균 그리고 즐겨찾기된 영화인지 여부를 조회하는 기능
-- 설명: 영화별 리뷰 갯수와 별점 평균 그리고 즐겨찾기된 영화인지 여부를 내림차순으로 정렬하여 조회하며, 페이징 처리하여 최대 25개씩 조회합니다.
SELECT 
    m.id,
    m.title movie_title,
    COUNT(r.id) review_count,
    IFNULL(AVG(r.rating), 0) average_rating,
    IF(f.id IS NULL, 0, 1) is_favorite
FROM 
    movie m
LEFT JOIN 
    review r ON m.id = r.movieId
LEFT JOIN 
    favorite_movies f ON m.id = f.movieId AND f.userId = 20
GROUP BY 
    m.id
ORDER BY 
    review_count DESC
LIMIT 
    0, 25;
    
-- 영화 즐겨찾기 등록 기능
-- input: userId, movieId
-- output: -
-- 특징: 특정 사용자가 특정 영화를 즐겨찾기에 등록하는 기능
-- 설명: userId와 movieId를 입력받아 해당 사용자가 해당 영화를 즐겨찾기에 등록합니다.

-- 영화 즐겨찾기 리스트 조회 기능
-- input: userId
-- output: 즐겨찾기한 영화 리스트 (최신순)
-- 특징: 특정 사용자의 영화 즐겨찾기 리스트를 최신순으로 조회하는 기능
-- 설명: userId를 입력받아 해당 사용자가 즐겨찾기한 영화 리스트를 최신순으로 조회합니다.
SELECT * FROM favorite_movies WHERE userId = 2 ORDER BY createdAt DESC;

-- 영화 즐겨찾기 해제 기능
-- input: userId, movieId
-- output: -
-- 특징: 특정 사용자가 특정 영화의 즐겨찾기를 해제하는 기능
-- 설명: userId와 movieId를 입력받아 해당 사용자가 해당 영화의 즐겨찾기를 해제합니다.
DELETE FROM favorite_movies WHERE userId = 2 AND movieId = 4;

-- 즐겨찾기한 영화 리스트 조회 기능
-- input: userId
-- output: 즐겨찾기한 영화 리스트 (제목, 장르, 관람객 수, 개봉일)
-- 특징: 특정 사용자가 즐겨찾기한 영화 리스트를 조회하는 기능
-- 설명: userId를 입력받아 해당 사용자가 즐겨찾기한 영화 리스트를 최신순으로 조회합니다.
SELECT m.title, m.genre, m.attendance, m.year
FROM movie m
INNER JOIN favorite_movies fm ON m.id = fm.movieId
WHERE fm.userId = 2
ORDER BY createdAt DESC;

-- 영화 상세정보 조회 기능
-- input: movieId
-- output: 영화 상세정보 (제목, 장르, 관람객 수, 개봉일, 평균 별점)
-- 특징: 특정 영화의 상세정보와 평균 별점을 조회하는 기능
-- 설명: movieId를 입력받아 특정 영화의 상세정보와 리뷰의 평균 별점을 조회합니다.
SELECT 
    m.title AS movie_title,
    m.genre,
    m.attendance,
    m.year,
    AVG(r.rating) AS average_rating
FROM 
    movie m
LEFT JOIN 
    review r ON m.id = r.movieId
WHERE 
    m.id = 4
GROUP BY 
    m.title;

-- 검색기록 추가 기능
-- input: userId, 검색 쿼리
-- output: -
-- 특징: 특정 사용자의 검색기록에 새로운 검색 쿼리를 추가하는 기능
-- 설명: userId와 검색 쿼리를 입력받아 해당 사용자의 검색기록에 새로운 검색 쿼리를 추가합니다.

-- 검색기록 조회 기능 (일반)
-- input: userId
-- output: 검색기록 리스트 (오름차순)
-- 특징: 특정 사용자의 검색기록을 조회하는 기능
-- 설명: userId를 입력받아 해당 사용자의 검색기록을 일반적인 순서로 조회합니다.
SELECT * FROM search_history WHERE userId = 20 ORDER BY search_query ASC;

-- 검색기록 조회 기능 (특정 시간 이후)
-- input: userId, search_time
-- output: 검색기록 리스트 (오름차순)
-- 특징: 특정 사용자의 특정 시간 이후의 검색기록을 조회하는 기능
-- 설명: userId와 검색 시간을 입력받아 해당 사용자의 특정 시간 이후의 검색기록을 조회합니다.
SELECT * FROM search_history WHERE userId = 20 AND search_time > '2024-01-01 00:00:00' ORDER BY search_query ASC;

-- 검색기록 제거 기능 (특정 검색 기록)
-- input: userId, 검색 기록 id
-- output: -
-- 특징: 특정 사용자의 특정 검색 기록을 제거하는 기능
-- 설명: userId와 검색 기록 id를 입력받아 해당 사용자의 특정 검색 기록을 제거합니다.
DELETE FROM search_history WHERE userId = 20 AND id = 2;

-- 검색기록 제거 기능 (모든 검색 기록)
-- input: userId
-- output: -
-- 특징: 특정 사용자의 모든 검색 기록을 제거하는 기능
-- 설명: userId를 입력받아 해당 사용자의 모든 검색 기록을 제거합니다.
DELETE FROM search_history WHERE userId = 20;

-- 리뷰 작성 기능
-- input: movieId, userId, rating, content
-- output: -
-- 특징: 특정 영화에 대해 특정 사용자가 리뷰를 작성하는 기능
-- 설명: movieId, userId, 평점, 리뷰 내용을 입력받아 특정 영화에 대해 특정 사용자가 리뷰를 작성합니다.

-- 특정 영화에 대한 리뷰 리스트 조회 기능
-- input: movieId
-- output: 최신순으로 페이징된 리뷰 리스트 (작성자 이름, 리뷰 내용, 별점)
-- 특징: 특정 영화에 대한 리뷰 리스트를 최신순으로 조회하는 기능
-- 설명: movieId를 입력받아 특정 영화에 대한 리뷰 리스트를 최신순으로 페이징하여 조회합니다.
SELECT
    u.nickname AS reviewer_name, 
    r.content AS review_content, 
    r.rating AS rating 
FROM 
    review r
INNER JOIN 
    user u ON r.userId = u.id
WHERE 
    r.movieId = 2
ORDER BY 
    r.updatedAt DESC
LIMIT 0, 25;

-- 특정 사용자가 작성한 리뷰 리스트 조회 기능
-- input: userId
-- output: 최신순으로 페이징된 리뷰 리스트
-- 특징: 특정 사용자가 작성한 리뷰 리스트를 최신순으로 조회하는 기능
-- 설명: userId를 입력받아 해당 사용자가 작성한 리뷰 리스트를 최신순으로 페이징하여 조회합니다.
SELECT 
    u.nickname AS reviewer_name, 
    r.content AS review_content, 
    r.rating AS rating 
FROM 
    review r
INNER JOIN 
    user u ON r.userId = u.id
WHERE 
    r.userId = 20
ORDER BY 
    r.updatedAt DESC
LIMIT 0, 25;

-- 리뷰 수정 기능
-- input: rating, content, 리뷰 id
-- output: -
-- 특징: 특정 리뷰의 평점과 내용을 수정하는 기능
-- 설명: rating, content, 리뷰 id를 입력받아 해당 리뷰의 평점과 내용을 수정합니다.
UPDATE review SET rating = 5, content = 'very nice movie!' WHERE id = 1000;

-- 리뷰 제거 기능
-- input: userId, 리뷰 id
-- output: -
-- 특징: 특정 사용자의 특정 리뷰를 제거하는 기능
-- 설명: userId와 리뷰 id를 입력받아 해당 사용자의 특정 리뷰를 제거합니다.
DELETE FROM review WHERE userId = 20 AND id = 1000;